import { Box, Typography } from "@mui/material";
import Chatbot from "../components/Chatbot";
function Report() {
  return (

    <Box sx={{ height: "85vh", padding: 2, display: "flex", flexDirection: "column" }}>

        <Box sx={{ p: 3 }}>
            <Typography variant="h5">Report</Typography>
            <Chatbot />
        </Box>
    </Box>
  );
}
export default Report;
